(* ::Package:: *)

ToNUMPY[IN_]:=Module[{expr},
	expr = StringReplace[ToString[InputForm[IN]],{"*^"->"e"}];
	StringReplace[expr,{"Cos"->"np.cos","ArcSin"->"np.arcsin","ArcTan"->"np.arctan", "Sin"->"np.sin","\[Pi]"->"np.pi","Mod"->"np.mod","Sqrt"->"np.sqrt","["->"(","]"->")","/"->"/","^"->"**","*"->"*"}]
]

AnalyticSol[akm_,ecc0_,inc0_,OM0_,om0_,M0_]:=Module[{lw0, h0, k0,q0, p0, lM0, orbnfanal},
	lw0 = om0 + OM0;
	h0 = ecc0 Cos[lw0]; 
	k0 = ecc0 Sin[lw0];
	q0 = Sin[inc0 /2] Cos[OM0];
	p0 = Sin[inc0 /2] Sin[OM0];
	lM0 = lw0 + M0;
	
	orbnfanal=Computemeanelementstime[akm,lM0,ecc0,lw0,inc0,OM0,0.0];
	orbnfanal
]

AnalyticEccInc[akm_,ecc0_,inc0_,OM0_,om0_,M0_]:=Module[{orbnfanal, eanal, ianal},
	orbnfanal = AnalyticSol[akm,ecc0,inc0,OM0,om0,M0];
	eanal = Sqrt[(heq/.orbnfanal)^2+(keq/.orbnfanal)^2];
	ianal =  2*ArcSin[Sqrt[(qeq/.orbnfanal)^2+(peq/.orbnfanal)^2]];
	{ToNUMPY@eanal, ToNUMPY@ianal}
]

AnalyticEquinoctical[ {akm_, ecc0_, inc0_, OM0_, om0_, M0_}, {t0_, tfin_, dt_} ]:=
  Module[{orbnfanal},
  orbnfanal = AnalyticSol[akm,ecc0,inc0,OM0,om0,M0];
  Table[({akm, heq, keq, qeq, peq, lM}/.orbnfanal)/.{t ->i}, {i, t0, tfin, dt}]
  ]

AnalyticKeplerian[ {akm_, ecc0_, inc0_, OM0_, om0_, M0_}, {t0_, tfin_, dt_} ]:=
  Module[{orbnfanal, eanal, ianal, OManal, lwanal, omData, MData, aanal},
    orbnfanal = AnalyticSol[akm,ecc0,inc0,OM0,om0,M0];
    eanal = Sqrt[(heq/.orbnfanal)^2+(keq/.orbnfanal)^2];
    ianal =  2*ArcSin[Sqrt[(qeq/.orbnfanal)^2+(peq/.orbnfanal)^2]];
    OManal = Mod[ArcTan[qeq, peq]/.orbnfanal, 2 Pi];
    lwanal = Mod[ArcTan[keq, heq]/.orbnfanal, 2 Pi];
    omanal = Mod[lwanal - OManal, 2 Pi];
    n = Sqrt[gmlnum/akm^3];
    manal = Mod[((lM+n-ome1num)/.orbnfanal) - lwanal, 2 Pi];
  Table[{akm, eanal, ianal, OManal, omanal, manal}/.{t ->i}, {i, t0, tfin, dt}]
  ]

ComputeCorrectionssimp[anum_, lM_, heq_, keq_, qeq_, peq_, t_] := 
    Module[{nnum, enum, etanum, sihnum, cihnum, lwnum, hnum, u1num, u2num, 
      u3num, u4num, omelw0num, omeh0num, domelwdLamnum, domehdLamnum, 
      domelwdGammnum, domehdGammnum, domelwdThetnum, domehdThetnum, 
      repargnum, divisornum, domenum, correctionlis}, 
     nnum = Sqrt[gmlnum/anum^3]; enum = Sqrt[heq^2 + keq^2]; 
      etanum = Sqrt[1 - heq^2 - keq^2]; sihnum = Sqrt[qeq^2 + peq^2]; 
      cihnum = Sqrt[1 - qeq^2 - peq^2]; lwnum = If[enum < 10^(-12), 0., 
        Mod[Sign[keq]*ArcCos[heq/enum], 2*Pi]]; 
      hnum = If[sihnum < 10^(-12), 0., Mod[Sign[peq]*ArcCos[qeq/sihnum], 
         2*Pi]]; u1num = u10num + ome1num*t; u2num = u20num + ome2num*t; 
      u3num = u30num + ome3num*t; u4num = u40num + ome4num*t; 
      repargnum = {a -> anum, n -> nnum, e -> enum, eta -> etanum, 
        sih -> sihnum, cih -> cihnum, lw -> lwnum, h -> hnum, u1 -> u1num, 
        u2 -> u2num, u3 -> u3num, u4 -> u4num}; 
      omelw0num = lwdot0numsimp /. repargnum; 
      omeh0num = hdot0numsimp /. repargnum; domelwdLamnum = 
       dlwdot0dLamnumsimp /. repargnum; domehdLamnum = 
       dhdot0dLamnumsimp /. repargnum; domelwdGammnum = 
       dlwdot0dGammnumsimp /. repargnum; domehdGammnum = 
       dhdot0dGammnumsimp /. repargnum; domelwdThetnum = 
       dlwdot0dThetnumsimp /. repargnum; domehdThetnum = 
       dhdot0dThetnumsimp /. repargnum; divisornum = 
       Table[divisorlist[[i]] -> divisorlist[[i]][[1]]*omelw0num + 
          divisorlist[[i]][[2]]*omeh0num + divisorlist[[i]][[3]]*ome1num + 
          divisorlist[[i]][[4]]*ome2num + divisorlist[[i]][[5]]*ome3num + 
          divisorlist[[i]][[6]]*ome4num, {i, 1, Length[divisorlist]}]; 
      domenum = {domelwdLam -> domelwdLamnum, domehdLam -> domehdLamnum, 
        domelwdGamm -> domelwdGammnum, domehdGamm -> domehdGammnum, 
        domelwdThet -> domelwdThetnum, domehdThet -> domehdThetnum}; 
      correctionlis = {da -> 0, dlM -> lMcorrectionnumsimp /. repargnum /. 
          divisornum /. domenum, dheq -> heqcorrectionnumsimp /. repargnum /. 
          divisornum /. domenum, dkeq -> keqcorrectionnumsimp /. repargnum /. 
          divisornum /. domenum, dqeq -> qeqcorrectionnumsimp /. repargnum /. 
          divisornum /. domenum, dpeq -> peqcorrectionnumsimp /. repargnum /. 
          divisornum /. domenum}; correctionlis]
 
